// import logo from '../src/front-view-virtual-studio-background-260nw-1883360125.webp';
import './App.css';
import React from 'react'

function App() {
  return (
    <>
      <h1 className="heading">Interview Portal</h1>
      <div className="container">
        <button>Participants</button>
        <button>Interviewers</button>
        <button>Schedule new Interview</button>
      </div>
      <div className='container'>Register YourSelf</div>
      <form>
          <input type="text" name="name" placeholder="Enter Name" />
          <input type="email" name="email" placeholder="Enter Email" />
          <input type="text" name="role" placeholder="Enter Your Role" />
        <input type="submit" value="Submit" />
      </form>
    </>
  )
}

export default App;
